// search logic
const tbody = document.getElementById('tbody');
const qEl = document.getElementById('q');
const matchArtistEl = document.getElementById('matchArtist');
const matchTitleEl = document.getElementById('matchTitle');
const countEl = document.getElementById('count');

// Normalize and strip accents for looser matching
function normalizeText(text) {
  return text
    .normalize('NFD')
    .replace(/[\u0300-\u036f]/g, '')    // remove accents/diacritics
    .toLowerCase()
    .replace(/[^a-z0-9\s]/g, '')        // remove punctuation
    .replace(/\s+/g, ' ')               // collapse spaces
    .trim();
}

function escapeHtml(s) {
  return s.replace(/[&<>"']/g, c => ({
    "&": "&amp;",
    "<": "&lt;",
    ">": "&gt;",
    "\"": "&quot;",
    "'": "&#39;"
  }[c]));
}

function searchAndShow() {
  const qRaw = qEl.value.trim();
  const qNorm = normalizeText(qRaw);
  const matchA = matchArtistEl.checked;
  const matchT = matchTitleEl.checked;

  const results = entries.filter(e => {
    if (!qNorm) return true;
    const artistNorm = normalizeText(e.artist);
    const titleNorm = normalizeText(e.title);
    return (
      (matchA && artistNorm.includes(qNorm)) ||
      (matchT && titleNorm.includes(qNorm))
    );
  });
  renderResults(results);
}

function renderResults(list) {
  tbody.innerHTML = '';
  if (list.length === 0) {
    tbody.innerHTML = '<tr><td colspan="3" class="small">No matches.</td></tr>';
    countEl.textContent = '0';
    return;
  }
  list.forEach((e, i) => {
    const tr = document.createElement('tr');
    tr.innerHTML = `<td>${i + 1}</td><td>${escapeHtml(e.artist)}</td><td>${escapeHtml(e.title)}</td>`;
    tbody.appendChild(tr);
  });
  countEl.textContent = String(list.length);
}

qEl.addEventListener('input', searchAndShow);
matchArtistEl.addEventListener('change', searchAndShow);
matchTitleEl.addEventListener('change', searchAndShow);
searchAndShow();
</script>
